// Playlist.js

import React from 'react';
import { FaMusic } from 'react-icons/fa';

function Playlist() {
  // Ganti dengan lagu-lagu favoritmu
  const songs = [
    { title: 'Lagu Favorit 1', url: '/assets/music/lagu1.mp3', favorite: true },
    { title: 'Lagu Favorit 2', url: '/assets/music/lagu2.mp3', favorite: false },
    { title: 'Lagu Favorit 3', url: '/assets/music/lagu3.mp3', favorite: false },
    { title: 'Lagu Favorit 4', url: '/assets/music/lagu4.mp3', favorite: false },
    { title: 'Lagu Favorit 5', url: '/assets/music/lagu5.mp3', favorite: false },
  ];
  return (
    <section className="playlist-section">
      <h2 className="playlist-header">Playlist Tahun Baru</h2>
      <div className="playlist-list">
        {songs.map((s, i) => (
          <div className="playlist-card animated-card" key={i} style={{animationDelay: `${i * 0.15}s`}}>
            <div className="playlist-title">
              <span className="icon-music-wrapper">
                <FaMusic className="playlist-icon" />
              </span>
              <span>{s.title}</span>
              {s.favorite && <span className="badge-favorite">FAVORITE</span>}
            </div>
            <audio controls src={s.url} className="playlist-audio" />
            <div className="playlist-visualizer">
              <div className="bar"></div>
              <div className="bar"></div>
              <div className="bar"></div>
              <div className="bar"></div>
              <div className="bar"></div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Playlist;
